import React, { useState } from 'react';
import '../../App.css';
import './nav.css'

function Nav() {
  const [showDiv1, setShowDiv1] = useState(false);
  const [showDiv2, setShowDiv2] = useState(false);


  const handleToggle1 = () => {
    setShowDiv1(!showDiv1);
  };

  const handleToggle2 = () => {
    setShowDiv2(!showDiv2);
  };




  return (
    <div>
      <nav id="nav">
        <div>        <button className='not_clicked' onClick={() => { handleToggle1(); }}>Кафедра </button>
          <button className='not_clicked' onClick={() => { handleToggle2(); }}>Багыттары </button>
          <button className='not_clicked' >Жанылыктар </button>
          <button className='not_clicked' >Иш-чаралар </button>
          <button className='not_clicked' >Байланыш үчүн </button></div>

        <div class="search" >
          <form class="search-bar">
            <input type="text" placeholder="Search.." name="q"></input>
            <button><i class="fa-solid fa-magnifying-glass"></i></button>
          </form>

        </div>
      </nav>
      {showDiv1 && (
        <div id="hiddenDiv1">
          <div class="container">
            <div class="togged_kafedra">
              <div class="part1">Кафедра</div>
              <div class="part2">
                <ul>
                  <li>Тарыхы</li>
                  <li>Курамы</li>
                  <li>Аккредитация</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
      {showDiv2 && (
        <div id="hiddenDiv2">
          <div class="container">
            <div class="togged_bagytary">
              <div class="part1">багыттар жана профилдер</div>
              <div class="part2">
                <ul>
                  <li>Графика</li>
                  <li>Информатика жана Эсептөө техникасы</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Nav;
